class TreeNode {
    int val;
    TreeNode left;
    TreeNode right;

    TreeNode() {
    }

    TreeNode(int val) {
        this.val = val;
    }

    TreeNode(int val, TreeNode left, TreeNode right) {
        this.val = val;
        this.left = left;
        this.right = right;
    }
}

class Graph {
    List<int[]>[] lists;
    int N;

    public Graph(int n, int[][] edges) {
        lists = new List[n];
        N = n;
        for (int i = 0; i < n; i++) {
            lists[i] = new ArrayList();
        }
        for (int[] edge : edges) {
            lists[edge[0]].add(new int[]{edge[1], edge[2]});
        }
    }

    public void addEdge(int[] edge) {
        lists[edge[0]].add(new int[]{edge[1], edge[2]});
    }

    public int shortestPath(int node1, int node2) {
        int[] distances = new int[N];
        Arrays.fill(distances, Integer.MAX_VALUE);
        distances[node1] = 0;
        PriorityQueue<int[]> pq = new PriorityQueue<>(Comparator.comparingInt(a -> a[1]));
        pq.offer(new int[]{node1, 0});
        while (!pq.isEmpty()) {
            int[] cur = pq.poll();
            int curr = cur[0], distance = cur[1];
            for (int[] adjacent : lists[curr]) {
                int next = adjacent[0], weight = adjacent[1];
                if (distances[next] > distance + weight) {
                    distances[next] = distance + weight;
                    pq.offer(new int[]{next, distances[next]});
                }
            }
        }

        return distances[node2] != Integer.MAX_VALUE ? distances[node2] : -1;
    }

}
